import React from 'react';

const TextField = ({ onChange, value }) => {
    return (
        <TextField sx={{
            '& .MuiInputBase-root': {
                "&:hover fieldset": {
                    borderColor: 'rgb(192, 192, 192);'
                },
                "&.Mui-focused": {
                    borderColor: 'blue'
                }
            },
            width: '60%'
        }} onChange={(e) => setPwd(e.target.value)} id='outlined-basic' variant='outlined' placeholder='비밀번호' value={pwd}></TextField>
    )
}

export default TextField
